var $bm_rt;
var freq, decay, t, startVal, endVal, dur, amp, w;
freq = 1;
decay = 5;
t = $bm_sub(time, inPoint);
startVal = [
    0,
    0
];
endVal = [
    50,
    50
];
$bm_rt = dur = 0.1;
if (t < dur) {
    $bm_rt = linear(t, 0, dur, startVal, endVal);
} else {
    amp = $bm_div($bm_sub(endVal, startVal), dur);
    w = $bm_mul($bm_mul(freq, Math.PI), 2);
    $bm_rt = $bm_sum(endVal, $bm_mul(amp, $bm_div($bm_div(Math.sin($bm_mul($bm_sub(t, dur), w)), Math.exp($bm_mul(decay, $bm_sub(t, dur)))), w)));
}
